import './css/App.css';
import './css/button.css'
import MatchGame from './MatchGame.js'

function App() {
  return (
    <div className="select-box">
       <h1>
          Select game
        </h1>
      <div>
       <button className="main-selection-button" onClick={MatchGame}>
 Match Game
       </button>
      </div>
    </div>
  );
}

export default App;
